import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return <Counter value={100} />;
}

const Counter = ({ value, onIncrement, onDecrement }) => {
  <div>
    <button onClick={onIncrement}>+</button>
    <h3>{value}</h3>
    <button onClick={onDecrement}>-</button>
  </div>;
};
